	def test_edit_infiltration(self):
		is_notA = False
		future_homes_standard_notional.edit_infiltration(self.project_dict, is_notA)
		self.assertEqual(self.project_dict["Infiltration"]["test_type"], "50Pa")
		self.assertEqual(self.project_dict["Infiltration"]["test_result"], 5)

		is_notA = True
		future_homes_standard_notional.edit_infiltration(self.project_dict, is_notA)
		self.assertEqual(self.project_dict["Infiltration"]["test_type"], "50Pa")
		self.assertEqual(self.project_dict["Infiltration"]["test_result"], 4)

		for opening in self.opening_lst:
			self.assertEqual(self.project_dict["Infiltration"][opening], 0)

		self.assertTrue("NumberOfWetRooms" in self.project_dict)
		wet_rooms_count = self.project_dict["NumberOfWetRooms"]
		self.assertTrue(wet_rooms_count > 1)
		self.assertTrue("extract_fans" in self.project_dict["Infiltration"])
		self.assertEqual(self.project_dict["Infiltration"]["extract_fans"], wet_rooms_count)

	def test_edit_opaque_ajdZTU_elements(self):

		future_homes_standard_notional.edit_opaque_ajdZTU_elements(self.project_dict)

		for zone in self.project_dict["Zone"].values():
			for building_element in zone["BuildingElement"].values():
				if building_element["pitch"] == HeatFlowDirection.DOWNWARDS:
					self.assertEqual(building_element["u_value"], 0.13)
				elif building_element["pitch"] == HeatFlowDirection.UPWARDS:
					self.assertEqual(building_element["u_value"], 0.11)
				elif building_element["pitch"] == HeatFlowDirection.HORIZONTAL:
					if "is_external_door" in building_element:
						if building_element["is_external_door"]:
							self.assertEqual(building_element["u_value"], 1.0)
						else:
							self.assertEqual(building_element["u_value"], 0.18)
					else:
						self.assertEqual(building_element["u_value"], 0.18)

